import axios from "axios";

const API_BASE_URL = "http://localhost:5000";

export const getJobs = async () => {
  return await axios.get(`${API_BASE_URL}/api/jobs`);
};

export const importJobs = async () => {
  return await axios.post(`${API_BASE_URL}/api/jobs/import`);
};

export const getImportLogs = async () => {
  return await axios.get(`${API_BASE_URL}/api/import-logs`);
};
